    researched both this report and the previous report (the 12 day Pre-Runoff report)
    to find that  the closing balance for the 12 Day PreRunoff does correspond to
    the opening balance for this report. I amended the 12 Day PreRunoff Report, but
    did not resubmit it. I surmise that this was the reason there were different amounts
    for the balances on the two reports. I am resubmitting both the 12 Day PreRunoff
    and the July 15 Quarterly reports.         8/25/03- This report contains updated
